de ser utilizado em sistemas de som interno e trios automotivos, com impedâncias variadas conforme os tipos de alto falantes, drivers e super tweeters. Todos os produtos possuem entradas RCA e crossover de ajuste fixo.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Classe de operação – (D)&lt;br /&gt;\r\n- Potência máxima @ 13,8 VDC (2 OHMS) - 150 WRMS (2x75W)&lt;br /&gt;\r\n- Potência máxima @ 13,8 VDC (4 OHMS) - 90 WRMS (2x45W)&lt;br /&gt;\r\n- Potência máxima @ 13,8 VDC (8 OHMS) - 50 WRMS (2x25W)&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n- Configurações:&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;2 x 75 Watts - 2 OHMS&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;1 x 150 Watts - 4 OHMS (Bridge)&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n- Sensibilidade de Entrada – 320mV a 3,2V&lt;br /&gt;\r\n- Distorção Harmônica Total (THD) – &amp;gt; 0,05%&lt;br /&gt;\r\n- Separação entre Canais (Crosstalk) – &amp;gt; 47dB&lt;br /&gt;\r\n- Relação Sinal / Ruído – &amp;gt; 90dB&lt;br /&gt;\r\n- Resposta de Frequência – 18Hz a 40kHz (-1dB)&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n- Crossover Fixo:&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;High Pass – 100Hz (-12dB/8ª)&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;Low Pass – 100Hz (-12dB/8ª)&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;Full Range (18Hz a 40kHz)&lt;br /&gt;\r\n&amp;nbsp;&lt;br /&gt;\r\n- Impedância de Entrada – 22K OHMS&lt;br /&gt;\r\n- Sistema de Proteção: Térmica e Curto na Saída&lt;br /&gt;\r\n- Tensão de Alimentação Mínima – 10,5VDC&lt;br /&gt;\r\n- Tensão de Alimentação Máxima – 15VDC&amp;nbsp;&lt;br /&gt;\r\n- Consumo em Repouso – 530mA&lt;br /&gt;\r\n- Cons. Máx. Musical @ 13,8 VDC – 7 Amp.&lt;br /&gt;\r\n- Cons. Máx. com Sinal Senoidal (1kHz) @ 13,8VDC – 13,5Amp&lt;br /&gt;\r\n- Dimensões (LxAxP) – 166 x 51 x 92mm&amp;nbsp;&lt;br /&gt;\r\n- Peso – 0,510Kg&lt;/p&gt;\r\n','','',''),(180,4,'Módulo Amplificador Taramps T500 500W 1 Canal 2 OHMS ','&lt;p&gt;&lt;span style=&quot;color: rgb(92, 102, 1