yle=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;L.P.F (Filtro Passa Baixa): 100Hz(-12dB/8ª)&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Eficiência do Estágio De Saída: &amp;gt;90%&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Impedância de Entrada:&amp;nbsp; 22K OHMS&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Sistema de Proteção - Térmica e Curto na Saída&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Tensão de Alimentação Mínima: 8VDC&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Tensão de Alimentação Máxima:&amp;nbsp; 16VDC&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo em Repouso:&amp;nbsp; 1 Amp.&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo Máximo Musical @ 13,8VDC: 19 Amp.&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo Máximo Em Sinal Senoidal (1kHz) 13,8VDC: 38 Amp.&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões (LxAxP): 134 x 42 x 144mm&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso: 0,6Kg&lt;/span&gt;&lt;/p&gt;\r\n','','',''),(182,4,'Módulo Amplificador Taramps TS600X4 600W 4 Canais 2OHMS','&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A TS é uma linha de amplificadores compacta e de alto rendimento, disponível em modelos de dois e quatro canais com resposta de frequência desde os sub graves até os agudos. O amplificador da linha TS pode ser utilizado em sistemas de som interno e trios automotivos, com impedâncias variadas conforme os tipos de alto falantes, drivers e super tweeters. Todos os produtos possuem entradas RCA e crossover de ajuste fixo.&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nEspecificação Técnica:\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Número de Canais: 4&lt;br /&gt;\r\nPotência Máxima @ 13,8 VDC - 2 OHMS: 720W RMS&lt;br /&gt;\r\nPotência Máxima @ 13,8 VDC - 4 OHMS: 432W RMS&amp;nbsp;&lt;br /&gt;\r\nPotência Máxima @ 13,8 VDC - 8 OHMS: 240W RMS&amp;nbsp;&lt;br /&gt;\r\nPotência Máxima @ 12,6 VDC - 2 OHMS: 600W RMS&amp;nbsp;&lt;br /&gt;\r\nPotência Máxima @ 12,6 VDC - 4 OHMS: 360W RMS&amp;nbsp;&lt;br /&gt;\r\nPotência Máxima @ 12,6 VDC - 8 OHMS: 198W RMS&amp;nbsp;&lt;br /&gt;\r\nConfigurações @ 12,6 VDC:&lt;br /&gt;\r\n4 Canais - 4 x 150 W RMS - 2 OHMS&lt;br /&gt;\r\n3 Canais - 2 x 150 W RMS - 2 OHMS&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp; + 1 x 300 W RMS - 4 OHMS - BRIDGE&lt;br /&gt;\r\n2 Canais&amp;nbsp; - 2 x 300 W RMS - 4 OHMS - BRIDGE&lt;br /&gt;\r\nSensibilidade de Entrada: 160mV (Com o Level a 100%.)&lt;br /&gt;\r\nDistorção Harmônica Total (THD): 0,45%&lt;br /&gt;\r\nSeparação entre Canais (Crosstalk): &amp;gt;60dB&lt;br /&gt;\r\nRelação Sinal/Ruido: &amp;gt;95dB&lt;br /&gt;\r\nResposta de Frequência (Full Range): 10Hz a 40kHz (-1dB)&lt;br /&gt;\r\nCrossover:&lt;br /&gt;\r\n&amp;nbsp;H.P.F (Filtro Passa Alta)-fixo: 100Hz(-12dB/8ª)&amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp;L.P.F (Filtro Passa Baixa)-fixo: 100Hz(-12dB/8ª)&amp;nbsp;&lt;br /&gt;\r\nEficiência: 80%&amp;nbsp;&lt;br /&gt;\r\nImpedância de Entrada: 18K OHMS&lt;br /&gt;\r\nSistema de Proteção: Curto na Saída / Tensão de alimentação Alta / Baixa&lt;br /&gt;\r\nTensão de Alimentação Mínima: 9VDC&lt;br /&gt;\r\nTensão de Alimentação Máxima: 16VDC&lt;br /&gt;\r\nConsumo em Repouso: 1,20 Amp.&lt;br /&gt;\r\nConsumo Máximo Musical @ 12,6VDC: 30 Amp.&lt;br /&gt;\r\nConsumo Máximo em Sinal Senoidal (1kHz) 12,6VDC: 60 Amp.&lt;br /&gt;\r\nDimensões (LxAxP): 168 x 54 x 255mm&lt;br /&gt;\r\nPeso: 1,52Kg&lt;/p&gt;\r\n&lt;/div&gt;\r\n','','',''),(184,4,'Módulo Amplificador Taramps TS1200X4 1200W RMS 4 Canais 2 OHMS','&lt;p&gt;A TS é uma linha de amplificadores compacta e de alto rendimento, disponível em modelos de dois e quatro canais com resposta de frequência desde os sub graves até os agudos. O amplificador da linha TS pode ser utilizado em sistemas de som interno e trios automotivos, com impedâncias variadas conforme os tipos de alto falantes, drivers e super tweeters. Todos os produtos possuem entradas RCA e crossover de ajuste fixo.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;- Número de Canais - 04&lt;br /&gt;\r\n- Pot. Máx. @ 13,8VDC (2 OHMS) - 1440 W RMS (4x360W RMS)&lt;br /&gt;\r\n- Pot. Máx. @ 13,8VDC (4 OHMS) - 950 W RMS (4x237W RMS)&lt;br /&gt;\r\n- Pot. Máx. @ 13,8VDC (8 OHMS) - 548 W RMS (4x137W RMS)&lt;br /&gt;\r\n- Pot. Máx. @ 12,6VDC&amp;nbsp; (2 OHMS) - 1200 W RMS (4x300W RMS)&lt;br /&gt;\r\n- Pot. Máx. @12,6VDC (4 OHMS) - 792W RMS (4x198W RMS)&lt;br /&gt;\r\n- Pot. Máx. @12,6VDC (8 OHMS) - 457 W RMS (4x109W RMS)&lt;br /&gt;\r\n- Pot. Máx. em Bridged @13,8VDC (4 OHMS) - 1440W RMS (2x720W RMS)&lt;br /&gt;\r\n- Pot. Máx. em Bridged @13,8VDC (8 OHMS) - 972W RMS (2x486W RMS)&lt;br /&gt;\r\n- Pot. Máx. em Bridged @12,6VDC (4 OHMS) - 1200W RMS (2x600W RMS)&lt;br /&gt;\r\n- Pot. Máx. em Bridged @12,6VDC (8 OHMS) - 810W RMS (2x405W RMS)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;- Bass Boost (Canais 3 e 4) - 0 a 10dB (50Hz)&lt;br /&gt;\r\n- Sensibilidade de Entrada - 160mV (Com o Leve a 100%.)&lt;br /&gt;\r\n- Distorção Harmônica Total (THD) - &amp;gt; 0,5%&lt;br /&gt;\r\n- Separação entre Canais (Crosstalk) - &amp;gt; 45dB&lt;br /&gt;\r\n- Relação Sinal / Ruído - &amp;gt;90dB&lt;br /&gt;\r\n- Resposta de Frequência (Full Range) - 20Hz a 30kHz (-1dB)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;- Crossover:&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp; H.P.F (Filtro Passa Alta) - Fixo 100Hz (-12dB/8ª)&lt;br /&gt;\r\n&amp;nbsp;&amp;nbsp; L.P.F (Filtro Passa Baixa)&amp;nbsp; - 100Hz (-12dB/8ª)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;- Impedância de Entrada - 18k OHMS&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;- Sistema de Proteção:&lt;br /&gt;\r\n- Curto na Saída e Tensão Alta / Baixa&lt;br /&gt;\r\n- Tensão de Alimentação Mínima - 10VDC&lt;br /&gt;\r\n- Tensão de Alimentação Máxima - 16VDC&amp;nbsp;&lt;br /&gt;\r\n- Consumo em Repouso - 2,20 Amp.&lt;br /&gt;\r\n- Cons. Máximo Musical @ 12,6VDC - 65 Amp.&lt;br /&gt;\r\n- Cons. Máximo com Sinal Senoidal (1kHz) @ 12,6VDC - 130Amp.&lt;br /&gt;\r\n- Dimensões (LxAxP) - 195 x 56 x 362mm&amp;nbsp;&lt;br /&gt;\r\n- Peso - 2,75Kg&lt;/p&gt;\r\n','','',''),(185,4,'Módulo Amplificador Taramps TS250X4 250W RMS 4 Canais 2 OHMS','&lt;p&gt;A TS é uma linha de amplificadores compacta e de alto rendimento, disponível em modelos de dois e quatro canais com resposta de frequência desde os sub graves até os agudos. O amplificador da linha TS pode ser utilizado em sistemas de som interno e trios automotivos, com impedâncias variadas conforme os tipos de alto falantes, drivers e super tweeters. Todos os produtos possuem entradas RCA e crossover de ajuste fixo.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Número de Canais: 04&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 10