ont-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo Máximo em Sinal Senoidal (1kHz) 13,8VDC: 36 Amp.&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões (LxAxP) - 134 x 42 x 188mm&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso - 0,6Kg&lt;/span&gt;&lt;/p&gt;\r\n','','',''),(190,4,'Módulo Amplificador Taramps TL500 100W RMS 2 Canais 2 Ohms Classe D','&lt;p&gt;&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A principal utilização dos amplificadores da linha TL é aumentar a potência dos sistemas internos de, mantendo a originalidade de cada configuração. É uma linha composta por amplificadores de diversos modelos - 1 canal (Mono); 2 canais (Estéreo); 3 canais (2 canais para médio grave e agudos bem definidos e 1 canal específico para sub grave) - &amp;nbsp;que transformam o interior do veículo em um verdadeiro espetáculo sonoro, oferecendo o máximo de qualidade musical e alta performance.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Número de Canais - 02&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;span style=&quot;line-height: 19.2px;&quot;&gt;Potência Máxima @ 14,4 VDC - 2 x 50 W RMS (Stereo 2 OHMS)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Tensão de Alimentação: 8 a 16 VDC&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo a Máxima Potência (Musical): 3,8 Amp.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo a Máxima Potência (Senoidal): &amp;nbsp;7,6 Amp.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Resposta de Frequência (-3dB): 80Hz ~ 40kHz&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Impedância de Entrada: 1K OHM&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Impedância de Saída: 2 OHMS&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Sistema de Proteção: Curto na Saída / Proteção Térmica&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões (LxAxP): 89 x 29 x 119mm&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso: 0,1Kg&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','','',''),(191,4,'Módulo Amplificador Taramps HD