=&quot;Open Sans, sans-serif&quot;&gt;&lt;span style=&quot;line-height: 19.2px;&quot;&gt;Especificação Técnica :&lt;/span&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Número de Canais: 01&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Potência Máxima @13,8 VDC - 4 OHMS: 1978W RMS&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Potência Máxima @13,8 VDC - 8 OHMS: 1181W RMS&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Potência Máxima @12,6 VDC - 4 OHMS: 1600W RMS&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Potência Máxima @12,6 VDC - 8 OHMS: 977W RMS&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Entrada e DSP:&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Conversor Analógico Digital (ADC): 24 bits, 96kHz, 110dB Faixa Dinâmica&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Processador Digital de Sinais (DSP): 24 bits, 96kHz&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Sensibilidade de Entrada para Máxima Potência: 250mV (Vol=100%)&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Resposta de Frequência @-1dB: 22Hz a 20kHz(-3dB)&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Resposta de Frequência @-3dB: 14Hz a 23kHz(-1dB)&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Crossover&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;H.P.F (Filtro Passa Alta): Full a 1kHz (-24dB/8ª) Variável&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;L.P.F (Filtro Passa Baixa): 50Hz a Full (-24dB/8ª) Variável&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Bass Boost: 0 a +10,5dB*&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Limiters / Anti-clipping: Selecionável 30%, 20%, 10% e 1%&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Seletor de Fase: 0/180º&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Gerenciamento Térmico: Smart Cooler (cooler acionado por temperatura ou áudio, com duas velocidades)&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Impedância de Entrada: 18K OHMS&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Sistema de Proteção: Curto na Saída / Tensão de Alimentação alta/baixa / Proteção Térmica&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Tensão de Alimentação Mínima: 9VDC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Tensão de Alimentação Máxima: 16 VDC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo em Repouso: 1,30A&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo Máximo Musical @ 12,6VDC: 78,5A&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo Máximo em Sinal Senoidal (1Khz) @12,6 VDC: 157A&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões (LxAxP): 230 x 73 x 177mm&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso: 2,00kg&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;* Paramétrico, 0 a +10,5dB em 40/50/60/80Hz&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;* Potência medida a 1KHz, impedância nominal (carga resistiva 1 , 2 e 4 OHMS). Temperatura 25ºC, THD em torno de&amp;nbsp;&amp;nbsp;&amp;nbsp;3%.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;* Devido a tolerâncias de componentes internos e do processo de fabricação, as características técnicas aqui apresentadas podem sofrer variações em torno de 5%.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(208,4,'Cabo RCA Taramps 5 metros 3mm Blindado','&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR INTERNO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Por se tratar de um cabo RCA de par de fio trançado temos dois condutores interno. O primeiro conjunto de fios composto por 10 filamentos em cobre OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm². O segundo conjunto de fios é composto por 10 filamentos em cobre estanhado OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm²&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A matéria-prima fundamental utilizada para a fabricação do condutor interno é o cobre&amp;nbsp;&lt;strong&gt;OFHC&lt;/strong&gt;&amp;nbsp;(alta condutividade térmica – livre de oxigênio) que oferece ótima condutividade e com pureza de 99,99% resistência nominal de 925 mohm/5m a 25ºC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;ISOLAMENTO DIELETRICO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Elemento principal de um cabo, pois a onda eletromagnética caminha no interior do dielétrico ao ser transmitido um sinal pelo condutor interno&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Constituído de PVC irradiado para sinais de alta frequência, suporta temperaturas elevadas com moderação&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR EXTEDRNO (BLINDAGEM)&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;O cabo RCA de pares trançados, combinam as técnicas de blindagem e cancelamento. Este tipo de cabo RCA possui pares de fios entrelaçados um ao redor do outro para cancelar as interferências eletromagnéticas de fontes externas e interferências de cabos vizinhos&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;O cabos de pares trançados possuem alta eficiência no cancelamento de ruídos devido à construção de pares trançados direcionais que melhora o CMRR (Common Mode Rejection Ratio) Índice de Rejeição de Modo Comum&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CAPA OU COBERTURA EXTERNA&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Cobertura externa translucida, fornece a proteção do cabo contra o meio externo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;PVC (Cloreto de polivinila) – possui como vantagem a flexibilidade&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONECTORES&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Conector RCA ultra compacto e bicolor para facilitar a identificação e ótima condução de sinal devido a sua construção continua com o cabo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Fabricado de latão CLA banhado em ouro industrial se tornando um ótimo condutor, possui cavidades com alta pressão e ponta fechada para uma melhor transferência de sinal&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(209,4,'Cabo RCA Taramps 5 metros 3 mm Azul Dupla Blindagem','&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR INTERNO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A composição do condutor interno é de cobre&amp;nbsp;&lt;strong&gt;OFHC&lt;/strong&gt;&amp;nbsp;(alta condutividade térmica – livre de oxigênio) e com pureza superior a 99%, resistividade nominal de 1,274 x 10-6&amp;nbsp;(ohm/cm) a 20ºC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Formado por fios sólidos de cobre que são utilizados para conectar sistemas de áudio que necessitam de flexibilidade e baixa resistência ôhmica do condutor interno&lt;/div&gt;\r\n\r\n&lt;div style=&quot;co