v&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;PVC (Cloreto de polivinila) – possui como vantagem a flexibilidade&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONECTORES&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Fabricados de latão CLA banhados em níquel se tornando um ótimo condutor de sinais, possui cavidades com alta pressão. A mola tem a função de aumentar a flexibilidade e não danificar o cabo&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(214,4,'Cabo Y RCA Taramps 1 conector Macho 2 Conectores Fêmea Blindado','&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR INTERNO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Por se tratar de um cabo RCA de par de fio trançado temos dois condutores interno. O primeiro conjunto de fios composto por 10 filamentos em cobre OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm². O segundo conjunto de fios é composto por 10 filamentos em cobre estanhado OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm²&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A matéria-prima fundamental utilizada para a fabricação do condutor interno é o cobre&amp;nbsp;&lt;strong&gt;OFHC&lt;/strong&gt;&amp;nbsp;(alta condutividade térmica – livre de oxigênio) que oferece ótima condutividade e com pureza de 99,99% resistência nominal de 925 mohm/5m a 25ºC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;ISOLAMENTO DIELETRICO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Elemento principal de um cabo, pois a onda eletromagnética caminha no interior do dielétrico ao ser transmitido um sinal pelo condutor interno&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Constituído de PVC irradiado para sinais de alta frequência, suporta temperaturas elevadas com moderação&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR EXTEDRNO (BLINDAGEM)&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;O cabo RCA de pares trançados, combinam as técnicas de blindagem e cancelamento. Este tipo de cabo RCA possui pares de fios entrelaçados um ao redor do outro para cancelar as interferências eletromagnéticas de fontes externas e interferências de cabos vizinhos&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;O cabos de pares trançados possuem alta eficiência no cancelamento de ruídos devido à construção de pares trançados direcionais que melhora o CMRR (Common Mode Rejection Ratio) Índice de Rejeição de Modo Comum&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CAPA OU COBERTURA EXTERNA&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Cobertura externa translucida, fornece a proteção do cabo contra o meio externo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;PVC (Cloreto de polivinila) – possui como vantagem a flexibilidade&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONECTORES&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Conector RCA ultra compacto e bicolor para facilitar a identificação e ótima condução de sinal devido a sua construção continua com o cabo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Fabricado de latão CLA banhado em ouro industrial se tornando um ótimo condutor, possui cavidades com alta pressão e ponta fechada para uma melhor transferência de sinal&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(215,4,'Cabo Y RCA Taramps 1 conector Fêmea 2 Conectores Macho Blindado','&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONDUTOR INTERNO&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Por se tratar de um cabo RCA de par de fio trançado temos dois condutores interno. O primeiro conjunto de fios composto por 10 filamentos em cobre OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm². O segundo conjunto de fios é composto por 10 filamentos em cobre estanhado OFHC (alta condutividade térmica – livre de oxigênio) de 0,127 mm²&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;A matéria-prima fundamental utilizada para a fabricação do condutor interno é o cobre&amp;nbsp;&lt;strong&gt;OFHC&lt;/strong&gt;&amp;nbsp;(alta condutividade térmica – livre de oxigênio) que oferece ótima condutividade e com pureza de 99,99% resistência nominal de 925 mohm/5m a 25ºC&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;