Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CAPA OU COBERTURA EXTERNA&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Cobertura externa translucida, fornece a proteção do cabo contra o meio externo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;PVC (Cloreto de polivinila) – possui como vantagem a flexibilidade&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&lt;strong&gt;CONECTORES&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Conector RCA ultra compacto e bicolor para facilitar a identificação e ótima condução de sinal devido a sua construção continua com o cabo&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Fabricado de latão CLA banhado em ouro industrial se tornando um ótimo condutor, possui cavidades com alta pressão e ponta fechada para uma melhor transferência de sinal&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(216,4,'Voltímetro VTR1000 Taramps Digital Led','&lt;p&gt;&lt;strong&gt;Voltímetro VTR1000 Taramps Digital Led&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Monitore a tensão de seu som com o voltímetro VTR100 e curta seu com com segurança e tranquilidade.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Com seu tamanho pequeno e compacto a instalação fica simples e fácil.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;• Faixa de medição: 5V a 30V&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;• Precisão (típica): +/-0,1V&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;• Consumo: 48mA @ 12,6V&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;• Alerta de bateria fraca&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&amp;nbsp;(abaixo de 10,2V o display pisca)&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;• Acionamento via remote&lt;/div&gt;\r\n','','',''),(217,4,'Voltímetro VTR1200 Taramps Digital Display Azul','&lt;p&gt;&lt;strong&gt;Voltímetro VTR1200&amp;nbsp;Taramps Digital Display Azul&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Monitore a tensão se seu som com segunrança, o voltímetro vtr 1200 controla a tensão de seus equipamentos cortando o sinal remoto de seu amplificador, quando a tensão estiver baixa impossibilitando que seus equipamentos queime.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Inovador, com design único, leve e transparente, funcional e prático muito fácil de ser instalado;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Display AZUL mostrando a marca de inovação que a TARAMPS proporciona a seus consumidores;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Para sua ligação sistema de conector destacável facilitando o esquema operacional de instalação&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Escala de Tensão de 10,2 a 27V DC;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Corrente máxima da saída remote (OUT) 650mA;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Consumo máximo de corrente: 60mA;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões: 120 X 88 X 30 mm;&lt;/span&gt;&lt;br style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot; /&gt;\r\n&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso: 0,1Kg.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','','',''),(218,4,'Mega Capacitor Taramps 300MF com Voltímetro','&lt;p&gt;&lt;strong&gt;Mega Capacitor Taramps 300MF com Voltímetro&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;O mega capacitor é responsável por manter a carga de sua bateria estável auxiliando nos momentos de pico do som, proporcionando que seus equipamentos possam obter 100% de seu desempenho.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Eleve a vida util de seus equipamentos, com a tecnologia taramps.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Especificação Técnica :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Design versátil e compacto&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;0.3 Farad de capacidade&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Para sistemas de 12 Volts DC&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Resistência Serie Equivalente (E.S.R): &amp;gt;0.002 ohm&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Acionamento Automático do Voltímetro quando há alteração da voltagem&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Voltimetro digital com display de 3 digitos&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Indicadores luminosos com LED&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Excelente rendimento, estabilidade e máxima segurança&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Alarme de Inversão de Polaridade&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Alerta de Sobre Voltagem (&amp;gt; 20 Volts) e Sub Voltagem (&amp;lt; 9 Volts)&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Faixa de temperatura de operação: -40ºC a 95ºC&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Múltiplas entradas de cabos&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Suportes e acessórios para montagem inclusos&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Dimensões (D x A): 76mm x 250mm&lt;/p&gt;\r\n\r\n&lt;p style=&quot;padding: 10px 0px; margin: 0px; color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;Peso: 1,20 Kg&lt;/p&gt;\r\n','','',''),(148,4,'Módulo Subida de Vidro Hyundai Veloster 2013 em Diante','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;br /&gt;\r\n&amp;nbsp; do veículo.&lt;br /&gt;\r\n- Módulo Completo (1 Módulo serve para as 4 portas)&lt;br /&gt;\r\n- Módulo Plug And Play com Conector Original&lt;br /&gt;\r\n- Não cortar o chicote original do carro para realizar a instalação&lt;br /&gt;\r\n&amp;nbsp; (desconecte o módulo original e ligue o módulo Tury)&lt;br /&gt;\r\n- Acompanha Informações sobre assistência Técnica e Garantia&lt;br /&gt;\r\n- Acompanha manual&lt;/p&gt;\r\n\r\n&lt;p&gt;Compatível com:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Hyundai Veloster - até 2013 em Diante&lt;/p&gt;\r\n','','',''),(220,4,'Módulo Subida de Vidro Hyundai Veloster até 2012','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;br /&gt;\r\n&amp;nbsp; do veículo.&lt;br /&gt;\r\n- Módulo Completo (1 Módulo serve para as 4 portas)&lt;br /&gt;\r\n- Módulo Plug And Play com Conector Original&lt;br /&gt;\r\n- Não cortar o chicote original do carro para realizar a instalação&lt;br /&gt;\r\n&amp;nbsp; (desconecte o módulo original e ligue o módulo Tury)&lt;br /&gt;\r\n- Acompanha Informações sobre assistência Técnica e Garantia&lt;br /&gt;\r\n- Acompanha manual&lt;/p&gt;\r\n\r\n&lt;p&gt;Compatível com:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Hyundai Veloster - até 2012&amp;nbsp;&lt;/p&gt;\r\n','','',''),(207,4,'Módulo Amplificador Taramps DSP1600 1600W RMS 1 Canal 1 Ohms','&lt;div class=&quot;somentemercadolivre&quot;&gt;Aqui vai a imagem&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;O DSP 3000 é um amplificador de 3000 watts de potência com design inovador e tecnologia DSP (DIGITAL SIGNAL PROCESSING INSIDE). Dono de uma resposta de frequência muito bem definida dos sub graves até os agudos, com o controle absoluto de todos os recursos monitorados através do DISPLAY.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;font color=&quot;#5c666b&quot; face=&quot;Open Sans, sans-serif&quot;&gt;&lt;span style=&quot;line-height: 19.2px;&quot;&gt;Especificação Técnica :&lt;/span&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div&gt;\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;\r\n&lt;div&gt;Número de Canais: 01&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @13,8 VDC - 1 OHM: 1976W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @13,8 VDC - 2 OHMS: 1304W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @13,8 VDC - 4 OHMS: 751W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @12,6 VDC - 1 OHM: 1600W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @12,6 VDC - 2 OHMS: 1066W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Potência Máxima @12,6 VDC - 4 OHMS: 620W RMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Entrada e DSP:&lt;/div&gt;\r\n\r\n&lt;div&gt;Conversor Analógico Digital (ADC): 24 bits, 96kHz, 110dB Faixa Dinâmica&lt;/div&gt;\r\n\r\n&lt;div&gt;Processador Digital de Sinais (DSP): 24 bits, 96kHz&lt;/div&gt;\r\n\r\n&lt;div&gt;Sensibilidade de Entrada para Máxima Potência: 250mV (Vol=100%)&lt;/div&gt;\r\n\r\n&lt;div&gt;Resposta de Frequência @-1dB: 22Hz a 20kHz(-1dB)&lt;/div&gt;\r\n\r\n&lt;div&gt;Resposta de Frequência @-3dB: 18Hz a 30kHz(-3dB)&lt;/div&gt;\r\n\r\n&lt;div&gt;Crossover&lt;/div&gt;\r\n\r\n&lt;div&gt;H.P.F (Filtro Passa Alta): Full a 1kHz (-24dB/8ª) Variável&lt;/div&gt;\r\n\r\n&lt;div&gt;L.P.F (Filtro Passa Baixa): 50Hz a Full (-24dB/8ª) Variável&lt;/div&gt;\r\n\r\n&lt;div&gt;Bass Boost: 0 a +10,5dB*&lt;/div&gt;\r\n\r\n&lt;div&gt;Limiters / Anti-clipping: Selecionável 30%, 20%, 10% e 1%&lt;/div&gt;\r\n\r\n&lt;div&gt;Seletor de Fase: 0/180º&lt;/div&gt;\r\n\r\n&lt;div&gt;Gerenciamento Térmico: Smart Cooler (cooler acionado por temperatura ou áudio, com duas velocidades)&lt;/div&gt;\r\n\r\n&lt;div&gt;Impedância de Entrada: 18K OHMS&lt;/div&gt;\r\n\r\n&lt;div&gt;Sistema de Proteção: Curto na Saída / Tensão de Alimentação alta/baixa / Proteção Térmica&lt;/div&gt;\r\n\r\n&lt;div&gt;Tensão de Alimentação Mínima: 9VDC&lt;/div&gt;\r\n\r\n&lt;div&gt;Tensão de Alimentação Máxima: 16 VDC&lt;/div&gt;\r\n\r\n&lt;div&gt;Consumo em Repouso: 1,0A&lt;/div&gt;\r\n\r\n&lt;div&gt;Consumo Máximo Musical @ 12,6VDC: 87A&lt;/div&gt;\r\n\r\n&lt;div&gt;Consumo Máximo em Sinal Senoidal (1Khz) @12,6 VDC: 174A&lt;/div&gt;\r\n\r\n&lt;div&gt;Dimensões (LxAxP): 230 x 73 x 177mm&lt;/div&gt;\r\n\r\n&lt;div&gt;Peso: 2,00kg&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;* Paramétrico, 0 a +10,5dB em 40/50/60/80Hz&lt;/div&gt;\r\n\r\n&lt;div style=&quot;color: rgb(92, 102, 107); font-family: \'Open Sans\', sans-serif; line-height: 19.2px;&quot;&gt;* Potência medida a 1KHz, impedância nominal (carga resistiva 1 , 2 e 4 OHMS). Temperatura 25ºC, THD em torno de&amp;nbsp;&amp;nbsp;&amp;nbsp;3%.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','','',''),(221,4,'Módulo Subida de Vidro Nissan Sentra 2010 até 2013','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; do veículo.&lt;/p&gt;\r\n\r\n&lt;p&gt;- Módulo Completo (1 Módulo serve para as 4 portas)&lt;/p&gt;\r\n\r\n&lt;p&gt;- Módulo Plug And Play com Conector Original&lt;/p&gt;\r\n\r\n&lt;p&gt;- Não cortar o chicote original do carro para realizar a instalação&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; (desconecte o módulo original e ligue o módulo Tury)&lt;/p&gt;\r\n\r\n&lt;p&gt;- Acompanha Informações sobre assistência Técnica e Garantia&lt;/p&gt;\r\n\r\n&lt;p&gt;- Acompanha manual&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Compatível com:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;- Nissan Sentra - 2010/2013&lt;/span&gt;&lt;/p&gt;\r\n','','',''),(157,4,'Módulo Subida de Vidro Nissan Sentra 2014 em diante','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; do veículo.&lt;/p&gt;\r\n\r\n&lt;p&gt;- Módulo Completo (1 Módulo serve para as 4 portas