 limpa seu som proprocionando melhor desempenho de seus equipamentos e durabilidade e nitidez sonora.&lt;/span&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;4 Canais&lt;br /&gt;\r\nMono/Stereo&lt;br /&gt;\r\nDistorção total harmônica: 0,05%&lt;br /&gt;\r\nRelação sinal/Ruído: 95dB&lt;br /&gt;\r\nFreqüência de Resposta: 10Hz-30KHz&lt;br /&gt;\r\nBass Boost: 0dB/6dB/12dB&lt;br /&gt;\r\nPotência total máxima: 1200W&amp;nbsp;&lt;br /&gt;\r\nPotência RMS&lt;br /&gt;\r\nPotência @ 2Ohms: 160Wx4&lt;br /&gt;\r\nPotência @ 4Ohms: 100Wx4&lt;br /&gt;\r\nBridge Potência 4Ohms: 320Wx2&lt;/p&gt;\r\n\r\n&lt;p&gt;Sensibilidade de entrada: 200mV-6V&lt;br /&gt;\r\nCorrente Elétrica: 27A (4 Ohms) / 43A (2 Ohms)&lt;br /&gt;\r\nHigh Pass: 40Hz-3KHz&lt;br /&gt;\r\nLow Pass: 30Hz-250Hz&lt;br /&gt;\r\nImpedância de entrada: 22K&lt;br /&gt;\r\nFusível: 25A&lt;br /&gt;\r\nImpedância mínima em stereo 2 ohms&lt;br /&gt;\r\nImpedância mínima em bridged 4 ohms&lt;br /&gt;\r\nCabos de alimentação bitola mínima 16mm&lt;br /&gt;\r\nDimensões: 316mm x 230mm x 46,5mm&lt;/p&gt;\r\n','','',''),(399,4,'Módulo Amplificador Hurricane HA 4.250 1000w  4 Canais','&lt;p&gt;Amplificador Hurricane HA 4.250 1000W 2 OHMS 4 Canais&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;line-height: 1.6em;&quot;&gt;A hurricane trouxe ao mercado um módulo versátil e potente, o módulo 4 canais da hurricane também pode ser ligado em 2 e 3 canais conforme especificações, transformando assim em um campeão de vendas no mercado de amplificadores, no momento que se pensa em qual som montar logo nos deparamos com qual módulo utilizar, trazemos a linha de módulos que amplifica e limpa seu som proprocionando melhor desempenho de seus equipamentos e durabilidade e nitidez sonora.&lt;/span&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;4 Canais&lt;br /&gt;\r\nMono/Stereo&lt;br /&gt;\r\nDistorção total harmônica: 0,05%&lt;br /&gt;\r\nRelação sinal/Ruído: 95dB&lt;br /&gt;\r\nFreqüência de Resposta: 10Hz-30KHz&lt;br