r /&gt;\r\n&lt;br /&gt;\r\nPotência: 180W (Par)&lt;br /&gt;\r\nImpedância: 4 OHMS&lt;br /&gt;\r\nFrequência: 60~20KHz&lt;br /&gt;\r\nCone Tipo: PP Molded&lt;br /&gt;\r\nBorda Borracha Surround&lt;br /&gt;\r\nTweeter Magnético 35mm PEI&lt;br /&gt;\r\n2 Super Tweeters Piezo 15mm&lt;br /&gt;\r\nDiâmetro woofer: 6x9&quot;&lt;br /&gt;\r\nCarcaça Metálica&lt;br /&gt;\r\nSPL (1W/1M): 90dB&lt;/p&gt;\r\n',' ','',''),(410,4,'Kit 2 Vias Hurricane 6&quot;  Mid Bass 130Wrms - CM 6.2','&lt;p&gt;Kit 2 Vias Hurricane Mida Bass 6 Poelgadas 130 W&amp;nbsp;rms&lt;/p&gt;\r\n\r\n&lt;p&gt;Os kit duas vias é essencial para quem busca potencia e qualidade sonora, o kit contem 2 tweeeter e 2 mida bass e 2 crossover onde juntos desempenham um papel fundamental no seu som, dando maior eficiencia e nitidez para seus ouvidos. Ideal para quem busca eficiencia em sonorização.&lt;/p&gt;\r\n\r\n&lt;p&gt;MidBass&lt;br /&gt;\r\nImpedância: 4 Ohms&lt;br /&gt;\r\nResp. Frequência: 100Hz ~ 5KHz&lt;br /&gt;\r\nCone Tipo: PP Moldado&lt;br /&gt;\r\nBorda Borracha Surround&lt;br /&gt;\r\nDiâmetro: 6.5&quot;&lt;br /&gt;\r\nSPL (1W/1M): 88dB&lt;/p&gt;\r\n\r\n&lt;p&gt;Tweeter&lt;br /&gt;\r\nImpedância: 4 Ohms&lt;br /&gt;\r\nFrequência: 3.5KHz ~ 20KHz&lt;br /&gt;\r\nDiafragma PEI: Imã Neodymium&lt;br /&gt;\r\nDiâmetro: 40mm (sem adaptadores)&lt;br /&gt;\r\nSPL (1W/1M): 87dB&lt;/p&gt;\r\n\r\n&lt;p&gt;Crossover&lt;br /&gt;\r\nFrequência de corte: 5KHz / 6dB/8ª&lt;br /&gt;\r\nProteção: Polyswitch&lt;br /&gt;\r\nTerminais de conexão&lt;/p&gt;\r\n',' ','',''),(411,4,'Kit 2 Vias Hurricane 5&quot;  Mid Bass 130Wrms - CM 5.2','&lt;p&gt;Kit 2 Vias Hurricane Mida Bass 5&amp;nbsp;Poelgadas 130 W&amp;nbsp;rms&lt;/p&gt;\r\n\r\n&lt;p&gt;Os kit duas vias é essencial para quem busca potencia e qualidade sonora, o kit contem 2 tweeeter e 2 mida bass e 2 crossover onde juntos desempenham um papel fundamental no seu som, dando maior eficiencia e nitidez para seus ouvidos. Ideal para quem busca eficiencia em sonorização.&lt;/p&gt;\r\n\r\n&lt;p&gt;MidBass&lt;br /&gt;\r\nImpedância: 4 Ohms&lt;br /&gt;\r\nResp. Frequência: 100Hz ~ 5KHz&lt;br /&gt;\r\nCone Tipo: PP Moldado&lt;br /&gt;\r\nBorda Borracha Surround&lt;br /&gt;\r\nDiâmetro: 5&quot;&lt;br /&gt;\r\nSPL (1W/1M): 88dB&lt;/p&gt;\r\n\r\n&lt;p&gt;Tweeter&lt;br /&gt;\r\nImpedância: 4 Ohms&lt;br /&gt;\r\nFrequência: 3.5KHz ~ 20KHz&lt;br /&gt;\r\nDiafragma PEI: Imã Neodymium&lt;br /&gt;\r\nDiâmetro: 40mm (sem adaptadores)&lt;br /&gt;\r\nSPL (1W/1M): 87dB&lt;/p&gt;\r\n\r\n&lt;p&gt;Crossover&lt;br /&gt;\r\nFrequência de corte: 5KHz / 6dB/8ª&lt;br /&gt;\r\nProteção: Polyswitch&lt;br /&gt;\r\nTerminais de conexão&lt;/p&gt;\r\n',' ','',''),(412,4,'Par de Driver Profisional Champion DRV 500 100 W rms ','&lt;p&gt;Os Drivers DRV500 foram projetados para quem quer alcançar altas potencias de média frequencia, além de ser muito utilizado em veiculos, este produto também pode ser utilizado em auditórios, igrejas, salões de festas.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Potencia RMS &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 100 W&lt;br /&gt;\r\nPotencia Musical &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;500 W&lt;br /&gt;\r\nImpedância &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;8 Ohms&lt;br /&gt;\r\nResposta de Frequencia &amp;nbsp; 400 a 9000 Hz&lt;br /&gt;\r\nSPL &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;1000 Hz&lt;br /&gt;\r\nDiafragma &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;107dB/w/m&lt;br /&gt;\r\nCorpo da Bobina &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Fenólico&lt;br /&gt;\r\nCorpo da Bobina &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Kapton&lt;br /&gt;\r\nPeso do Imã &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 512 g&lt;br /&gt;\r\nDimensões do Imã &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;102 x 16 cm&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Kit Acompanha :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- 2 Driver DRV 500&lt;br /&gt;\r\n&lt;span style=&quot;line-height: 1.6em;&quot;&gt;- 2 Corneta Curta&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;justify&quot; style=&quot;margin: 0.5em 0px; padding: 0px; border: 3px; outline: 0px; vertical-align: baseline; box-sizing: content-box; line-height: normal; font-family: Arial, Helvetica, \'Nimbus Sans L\', sans-serif; font-size: 13px;&quot;&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n','','',''),(413,4,'Par de SuperTweeter Profisional Champion  100 W rms STW500','&lt;p&gt;Os Super Tweeters&amp;nbsp;foram projetados para quem quer alcançar altas potencias de média frequencia, além de ser muito utilizado em veiculos, este produto também pode ser utilizado em auditórios, igrejas, salões de festas. Ótimo desempenho e qualidade sonora, superando as expectativas dos clientes.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Potencia RMS &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 100 W&lt;br /&gt;\r\nPotencia Musical &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;500 W&lt;br /&gt;\r\nImpedância &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;8 Ohms&lt;br /&gt;\r\nResposta de Frequencia &amp;nbsp; 400 a 9000 Hz&lt;br /&gt;\r\nSPL &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;1000 Hz&lt;br /&gt;\r\nDiafragma &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;107dB/w/m&lt;br /&gt;\r\nCorpo da Bobina &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Fenólico&lt;br /&gt;\r\nCorpo da Bobina &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Kapton&lt;br /&gt;\r\nPeso do Imã &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 512 g&lt;br /&gt;\r\nDimensões do Imã &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;102 x 16 cm&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Kit Acompanha :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- 2 Super Tweeters&amp;nbsp;STW&amp;nbsp;500&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;justify&quot; style=&quot;margin: 0.5em 0px; padding: 0px; border: 3px; outline: 0px; vertical-align: baseline; box-sizing: content-box; line-height: normal; font-family: Arial, Helvetica, \'Nimbus Sans L\', sans-serif; font-size: 13px;&quot;&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n','','',''),(414,4,'Módulo Subida de Vidro Hyundai HB20 2016 Vidros Dianteiros','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;br /&gt;\r\n&amp;nbsp; do veículo.&lt;br /&gt;\r\n- Módulo Completo (1 Módulo serve para as 4 portas)&lt;br /&gt;\r\n- Módulo Plug And Play com Conector Original&lt;br /&gt;\r\n- Não cortar o chicote original do carro para realizar a instalação&lt;br /&gt;\r\n&amp;nbsp; (desconecte o módulo original e ligue o módulo Tury)&lt;br /&gt;\r\n- Acompanha Informações sobre assistência Técnica e Garantia&lt;br /&gt;\r\n- Acompanha manual&lt;/p&gt;\r\n\r\n&lt;p&gt;Compatível com:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Hyundai HB20 - 2016 em diante com vidros somente na dianteira.&lt;/p&gt;\r\n','','',''),(415,4,'Alarme Positron Exact 330 Universal 2 Controles ','&lt;p&gt;A linha Exact 330 é o alarme da positron com o melhor custo benefício, compatível com sensor, comátível com o sensor de violação tras maior seguraça e tranquilidade para o usuário, além de ajudar a melhorar a relação nos custos com as seguradoras.&amp;nbsp;&lt;br /&gt;\r\nO alarme Exact 330 vai acompanhado de 2 controles, saída auxiliar, função anti assalto, rearme automático para que o veiculo nunca fique destivado na rua ou em qualquer local de maneira indesejada, conta também com a função panico e a função localizador.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Características&lt;/p&gt;\r\n\r\n&lt;p&gt;- Compatível com Sensor de violação: dispositivo de rádio frequência (sem fio) que pode ser instalado para aviso em caso de violação do estepe, porta-luvas, bagageiros de teto, entre outros.&lt;br /&gt;\r\n- Acompanha 2 controles convencionais PXN 48&lt;br /&gt;\r\n- 1 Saída Auxiliar que possibilita acionar equipamentos do veículo, como, por exemplo, descida dos vidros elétricos (inclusive originais), ou abertura do porta-malas, ao ativar o alarme(1).&lt;br /&gt;\r\n- Módulo com exclusiva Tecnologia ASIC(Application Specific Integrated Circuit), circuito integrado que torna o módulo mais resistente à interferências eletromagnéticas e evita disparos falsos&lt;br /&gt;\r\n- Exclusiva Tecnologia PAN (Pósitron Area Network), que permite que o alarme se comunique com outros produtos da linha Pósitron&lt;br /&gt;\r\n- Controles remotos com Sistema Pósitron anticlonagem New Flex-Code&lt;br /&gt;\r\n- Longo alcance dos controles remotos, em conformidade com as normas da Anatel&lt;br /&gt;\r\n- Bateria de longa duração&lt;br /&gt;\r\n- Gravação de até 4 controles remotos&lt;br /&gt;\r\n- Controle de som: ao desligar o carro e ativar o alarme, o som é desligado automaticamente. Ao desativar o alarme e abrir a porta, o som é ligado automaticamente&lt;br /&gt;\r\n- Sirene com volume de som mais alto, mais nítido e tamanho reduzidoatendendo às normas do Contran(2)&lt;br /&gt;\r\n- Trava Automática “Autolock”:função que possibilita o travamento das portas em 5 segundos após a ignição ter sido ligada e destrava as portas ao desligar a ignição&lt;br /&gt;\r\n- Função temporizador de setas:acendimento das setas por 10 segundos ao pressionar o botão desliga duas vezes&lt;br /&gt;\r\n- Função “Auxílio de Localização”: caso você não se lembre onde seu carro está estacionado, esta função permite piscar as setas do veículo pressionando o botão auxiliar do controle remoto por 03 segundos&lt;br /&gt;\r\n- Cancelamento temporário do sensor de ultrassom através do controle remoto, para situações em que não se deseja detectar movimento dentro do carro, mesmo com o alarme ativado&lt;br /&gt;\r\n- Disparo do alarme em caso de tentativa de curtos-circuitos ou da retirada das cápsulas receptoras de ultrassom&lt;br /&gt;\r\n- Disparo de advertência por controle remoto, pressionando o botão liga por alguns segundos&lt;br /&gt;\r\n- Permite comandar as travas elétricas do veículo por controle remoto(3)&lt;br /&gt;\r\n- Permite cancelar o sinal sonoro ao ativar e desativar o alarme&lt;br /&gt;\r\n- Reativa automaticamente o alarme ao desativá-lo e não entrar no veículo&lt;br /&gt;\r\n- Beep personalizado ao ativar e desativar o alarme (6 opções diferentes)&lt;br /&gt;\r\n- Possibilidade de monitorar o interior do veículo através do ultrassom com LED externo e interno&lt;br /&gt;\r\n- Permite o acionamento de portões eletrônicos.(3)&lt;br /&gt;\r\n- 3 anos de garantia&lt;/p&gt;\r\n','','',''),(416,4,'Alarme Positron FX 330 Universal 2 Controles ','&lt;p&gt;A linha FX&amp;nbsp;330 é o alarme da positron com o melhor custo benefício, compatível com sensor, comátível com o sensor de violação tras maior seguraça e tranquilidade para o usuário, além de ajudar a melhorar a relação nos custos com as seguradoras.&amp;nbsp;&lt;br /&gt;\r\nO alarme FX&amp;nbsp;330 vai acompanhado de 2 controles,com 2 saídas auxiliares, função anti assalto, rearme automático para que o veiculo nunca fique destivado na rua ou em qualquer local de maneira indesejada, conta também com a função panico e a função localizador, permite também que o proprietário desligue o som&amp;nbsp;para evitar o descarregamento da bateria.&lt;/p&gt;\r\n\r\n&lt;p&gt;Características&lt;/p&gt;\r\n\r\n&lt;p&gt;- Compatível com Sensor de violação: dispositivo de rádio frequência (sem fio) que pode ser instalado para aviso em caso de violação do estepe, porta-luvas, bagageiros de teto, entre outros.&lt;br /&gt;\r\n- Compatibilidade com a função bloqueio por presença: ou seja, ao afastar o controle do veículo, o motor de partida é bloqueado automaticamente. Relé de bloqueio integrado(1)&lt;br /&gt;\r\n- Acompanha 2 controles convencionais PXN52&lt;br /&gt;\r\n- 1 Saída Auxiliar que possibilita acionar equipamentos do veículo, como, por exemplo, descida dos vidros elétricos (inclusive originais), ou abertura do porta-malas, ao ativar o alarme.(2)&lt;br /&gt;\r\n- Módulo com exclusiva Tecnologia ASIC(Application Specific Integrated Circuit), circuito integrado que torna o módulo mais resistente à interferências eletromagnéticas e evita disparos falsos&lt;br /&gt;\r\n- Exclusiva Tecnologia PAN (Pósitron Area Network), que permite que o alarme se comunique com outros produtos da linha Pósitron&lt;br /&gt;\r\n- Controles remotos com Sistema Pósitron anticlonagem New Flex-Code&lt;br /&gt;\r\n- Longo alcance dos controles remotos, em conformidade com as normas da Anatel&lt;br /&gt;\r\n- Bateria de longa duração&lt;br /&gt;\r\n- Gravação de até 4 controles remotos&lt;br /&gt;\r\n- Controle de som:ao desligar o carro e ativar o alarme, o som é desligado automaticamente. Ao desativar o alarme e abrir a porta, o som é ligado automaticamente&lt;br /&gt;\r\n- Sirene com volume de som mais alto, mais nítido e tamanho reduzidoatendendo às normas do Contran(3)&lt;br /&gt;\r\n- Trava Automática “Autolock”: função que possibilita o travamento das portas em 5 segundos após a ignição ter sido ligada e destrava as portas ao desligar a ignição&lt;br /&gt;\r\n- Função temporizador de setas:acendimento das setas por 10 segundos ao pressionar o botão desliga duas vezes&lt;br /&gt;\r\n- Função “Auxílio de Localização”: caso você não se lembre onde seu carro está estacionado, esta função permite piscar as setas do veículo pressionando o botão auxiliar do controle remoto por 03 segundos&lt;br /&gt;\r\n- Cancelamento temporário do sensor de ultrassom através do controle remoto, para situações em que não se deseja detectar movimento dentro do carro, mesmo com o alarme ativado&lt;br /&gt;\r\n- Disparo do alarme em caso de tentativa de curtos-circuitos ou da retirada das cápsulas receptoras de ultrassom&lt;br /&gt;\r\n- Disparo de advertência por controle remoto, pressionando o botão liga por alguns segundos&lt;br /&gt;\r\n- Permite comandar as travas elétricas do veículo por controle remoto&lt;br /&gt;\r\n- Permite cancelar o sinal sonoro ao ativar e desativar o alarme&lt;br /&gt;\r\n- Reativa automaticamente o alarme ao desativá-lo e não entrar no veículo&lt;br /&gt;\r\n- Beep personalizado ao ativar e desativar o alarme (6 opções diferentes)&lt;br /&gt;\r\n- Possibilidade de monitorar o interior do veículo através do ultrassom com LED externo e interno&lt;br /&gt;\r\n- Permite o acionamento de portões eletrônicos.(4)&lt;br /&gt;\r\n- 3 anos de garantia&lt;/p&gt;\r\n','','',''),(417,4,'Alarme Positron PX330 Universal Função Presença ','&lt;p&gt;A linha PX&amp;nbsp;330 é o alarme da positron com o maior indice de segurança, além de toda tecnologia positron é o alarme mais completo da linha contendo a função presença junto ao alarme dando assim tranquilidade ao usuario.&amp;nbsp;&lt;br /&gt;\r\nO alarme PX&amp;nbsp;330 vai acompanhado de 2 controles,com 2 saídas auxiliares, Função Presença,função anti assalto, rearme automático para que o veiculo nunca fique destivado na rua ou em qualquer local de maneira indesejada, conta também com a função panico e a função localizador, permite também que o proprietário desligue o som&amp;nbsp;para evitar o descarregamento da bateria.&lt;/p&gt;\r\n\r\n&lt;p&gt;Características&lt;/p&gt;\r\n\r\n&lt;p&gt;- Modo Assalto passivo por interruptor de porta ou ignição: quando a ignição for ligada e/ou uma porta do veículo for aberta e o botão secreto não for pressionado, o alarme dispara e bloqueia o motor de partida ou bomba de combustível(1)&lt;br /&gt;\r\n- Compatível com Sensor de violação: dispositivo de rádio frequência (sem fio) que pode ser instalado para aviso em caso de violação do estepe, porta-luvas, bagageiros de teto, entre outros&lt;br /&gt;\r\n- Acompanha controle remoto de presença DPN54: ao afastar o controle do veículo, o motor de partida é bloqueado automaticamente. Relé de bloqueio integrado(2)&lt;br /&gt;\r\n- Aviso de lanterna ligada através da sirene, ao desligar a ignição e abrir a porta&lt;br /&gt;\r\n- 2 Saídas auxiliares que possibilitam acionar até 2 equipamentos do seu veículo, como, por exemplo, descida dos vidros elétricos (inclusive originais) ou abertura do porta-malas e temporização dos faróis do veículo ou da luz de cortesia.(3)&lt;br /&gt;\r\n- Acompanha um controle PXN54 (convencional) e um controle DPN54 (de presença)&lt;br /&gt;\r\n- Módulo com exclusiva Tecnologia ASIC (Application Specific Integrated Circuit), circuito integrado que torna o módulo mais resistente à interferências eletromagnéticas e evita disparos falsos&lt;br /&gt;\r\n- Exclusiva Tecnologia PAN (Pósitron Area Network), que permite que o alarme se comunique com outros produtos da linha Pósitron&lt;br /&gt;\r\n- Controles remotos com Sistema Pósitron anticlonagem New Flex-Code&lt;br /&gt;\r\n- Longo alcance dos controles remotos, em conformidade com as normas da Anatel&lt;br /&gt;\r\n- Bateria de longa duração&lt;br /&gt;\r\n- Gravação de até 4 controles remotos&lt;br /&gt;\r\n- Controle de som: ao desligar o carro e ativar o alarme, o som é desligado automaticamente. Ao desativar o alarme e abrir a porta, o som é ligado automaticamente&lt;br /&gt;\r\n- Sirene com volume de som mais alto, mais nítido e tamanho reduzido atendendo às normas do Contran(4)&lt;br /&gt;\r\n- Trava Automática “Autolock”: função que possibilita o travamento das portas em&amp;nbsp;&lt;br /&gt;\r\n- 5 segundos após a ignição ter sido ligada e destrava as portas ao desligar a ignição&lt;br /&gt;\r\n- Função temporizador de setas: acendimento das setas por 10 segundos ao pressionar o botão desliga duas vezes&lt;br /&gt;\r\n- Função “Auxílio de Localização”: caso você não se lembre onde seu carro está estacionado, esta função permite piscar as setas do veículo pressionando o botão auxiliar do controle remoto por 03 segundos&lt;br /&gt;\r\n- Cancelamento temporário do sensor de ultrassom através do controle remoto, para situações em que não se deseja detectar movimento dentro do carro, mesmo com o alarme ativado&lt;br /&gt;\r\n- Disparo do alarme em caso de tentativa de curtos-circuitos ou da retirada das cápsulas&amp;nbsp;&lt;br /&gt;\r\n- receptoras de ultrassom&lt;br /&gt;\r\n- Disparo de advertência por controle remoto, pressionando o botão liga por alguns segundos&lt;br /&gt;\r\n- Permite comandar as travas elétricas do veículo por controle remoto&lt;br /&gt;\r\n- Permite cancelar o sinal sonoro ao ativar e desativar o alarme&lt;br /&gt;\r\n- Reativa automaticamente o alarme ao desativá-lo e não entrar no veículo&lt;br /&gt;\r\n- Beep personalizado ao ativar e desativar o alarme (6 opções diferentes)&lt;br /&gt;\r\n- Possibilidade de monitorar o interior do veículo através do ultrassom com LED externo e interno&lt;br /&gt;\r\n- Permite o acionamento de portões eletrônicos.(5)&lt;br /&gt;\r\n- 3 anos de garantia&lt;/p&gt;\r\n','','',''),(418,4,'Alarme Positron Duobloc Pro 330','&lt;p&gt;Alinha de alarmes Duobloc Pro 330 Conta com o que há de melhor sobre tecnologia em segurança, podendo ser instalado em qualquer moto do mercado, além de otima durabilidade e resistencia para aguentar o dia a dia de quem anda de moto, é o alarme com o melhor custo benefício do mercado.&lt;/p&gt;\r\n\r\n&lt;p&gt;Características&lt;/p&gt;\r\n\r\n&lt;p&gt;- Aplicação universal: compatível com todas as motocicletas disponíveis no mercado brasileiro&amp;nbsp;&lt;br /&gt;\r\n- Módulo com exclusiva Tecnologia ASIC (Application Specific Integrated Circuit), circuito integrado que torna o módulo mais resistente à interferências eletromagnéticas e evita disparos falsos&amp;nbsp;&lt;br /&gt;\r\n- Exclusiva Tecnologia PAN (Pósitron Area Network), que permite que o alarme se comunique com outros produtos da linha Pósitron(1)&amp;nbsp;&lt;br /&gt;\r\n- Compatível com Sensor de violação: dispositivo de rádio frequência (sem fio) que pode ser instalado para aviso em caso de violação do baú e bancos removíveis, entre outros&amp;nbsp;&lt;br /&gt;\r\n- Controles remotos com Sistema Pósitron anticlonagem New Flex-Code&amp;nbsp;&lt;br /&gt;\r\n- Acompanha 02 Controles de Presença Pósitron DPN48: ao afastar o controle da moto, o motor de partida é bloqueado automaticamente&amp;nbsp;&lt;br /&gt;\r\n- Fácil operação - Ativação do alarme ao pressionar o botão “liga” do controle remoto ou se afastando com o controle da motocicleta&amp;nbsp;&lt;br /&gt;\r\n- Senha secreta para habilitar ou desabilitar o alarme na ignição em caso de perda do controle remoto&lt;br /&gt;\r\n- Longo alcance dos controles remotos, em conformidade com as normas da Anatel&lt;br /&gt;\r\n- Bateria de longa duração Gravação de até 4 controles remotos&lt;br /&gt;\r\n- Exclusivo sensor de movimento com acelerômetro 3D: identifica movimentos nas 3 dimensões: lados, cima, baixo, e dispara a sirene em caso de movimentação da motocicleta mesmo com ignição desligada(1)&lt;br /&gt;\r\n- Função Modo Assalto por Controle Remoto: em caso de assalto você pode ativar o alarme com a ignição ligada, pressionado o botão liga do controle remoto. As setas da moto piscarão, avisando que o modo assalto foi ativado. Quando a moto se afasta, a sirene dispara, as setas piscam e acontece o bloqueio do motor de partida.&amp;nbsp;&lt;br /&gt;\r\n- Sirene com volume de som mais alto, mais nítido e tamanho reduzido atendendo as normas do Contran(4)&lt;br /&gt;\r\n- Função “Auxílio de Localização”: permite piscar as setas da moto, pressionando o botão desliga do controle remoto por 06 segundos&lt;br /&gt;\r\n- Beep personalizado ao ativar e desativar o alarme (6 opções diferentes)&amp;nbsp;&lt;br /&gt;\r\n- Disparo do alarme em caso de tentativa de curtos-circuitos&amp;nbsp;&lt;br /&gt;\r\n- Alarme não interfere no funcionamento da motocicleta&amp;nbsp;&lt;br /&gt;\r\n- Controles remotos, módulos e sirene selados e resistentes à água Baixo consumo da bateria da motocicleta&amp;nbsp;&lt;br /&gt;\r\n- 1 ano de garantia&lt;/p&gt;\r\n','','',''),(419,4,'Módulo Subida de Vidro Peugeot 206 Hatch / Sw / Sedan 4 Vidros','&lt;p&gt;- Produto projetado para ser instalado mantendo a originalidade&lt;br /&gt;\r\n&amp;nbsp; do veículo.&lt;br /&gt;\r\n- Módulo Completo (1 Módulo serve para as 4 portas)&lt;br /&gt;\r\n- Módulo Plug And Play com Conector Original&lt;br /&gt;\r\n- Não cortar o chicote original do carro para realizar a instalação&lt;br /&gt;\r\n&amp;nbsp; (desconecte o módulo original e ligue o módulo Tury)&lt;br /&gt;\r\n- Acompanha Informações sobre assistência Técnica e Garantia&lt;br /&gt;\r\n- Acompanha manual&lt;/p&gt;\r\n\r\n&lt;p&gt;Compatível com:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Peugeto 206 Hatch / Sedan / Sw com vidros elétricos nas 4 Portas&lt;/p&gt;\r\n','','','');
