&quot;color: #333; font-size: 68px;&quot;&gt;&lt;b&gt;&amp;nbsp;12x&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;/td&gt;\r\n						&lt;td&gt;&lt;span style=&quot;font-size: 28px; color: #333;&quot;&gt;&lt;b&gt;SEM JUROS&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;br /&gt;\r\n						&lt;span style=&quot;font-size: 16px; color: #333;&quot;&gt;&lt;b&gt;PELO MERCADO PAGO&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;/td&gt;\r\n					&lt;/tr&gt;\r\n				&lt;/tbody&gt;\r\n			&lt;/table&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px;&quot;&gt;\r\n&lt;div style=&quot;margin-top: 20.0px;&quot;&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px;&quot;&gt;\r\n&lt;div style=&quot;margin-top: 20.0px; font-family: \'Open Sans\' , sans-serif; font-size: 32.0px; padding: 10.0px; color: #ffffff; background-color: #006089; border-radius: 4.0px;&quot;&gt;Descrição técnica&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-top: 20.0px; text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: normal; font-size: 16px;&quot;&gt;__CONTENT__&lt;/span&gt;\r\n\r\n&lt;center&gt;&amp;nbsp;&lt;/center&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px;&quot;&gt;\r\n&lt;div style=&quot;margin-top: 20.0px; font-family: \'Open Sans\' , sans-serif; font-size: 32.0px; padding: 10.0px; color: #ffffff; background-color: #006089; border-radius: 4.0px;&quot;&gt;Formas de envio&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-top: 20.0px;&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;Formas de envio&quot; src=&quot;http://i76.photobucket.com/albums/j37/garciasousa/vidros%20eletricos/correios_zpskgel7g49.png&quot; width=&quot;880&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px;&quot;&gt;\r\n&lt;div style=&quot;margin-top: 20.0px; font-family: \'Open Sans\' , sans-serif; font-size: 32.0px; padding: 10.0px; color: #ffffff; background-color: #006089; border-radius: 4.0px;&quot;&gt;Formas de pagamento&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-top: 20.0px;&quot;&gt;\r\n&lt;p&gt;&lt;img alt=&quot;Mercdo Pago&quot; src=&quot;http://i1217.photobucket.com/albums/dd390/piushop1/mercado_pago_zps60670ce4.jpg&quot; /&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px;&quot;&gt;\r\n&lt;div style=&quot;margin-top: 20.0px; font-family: \'Open Sans\' , sans-serif; font-size: 32.0px; padding: 10.0px; color: #ffffff; background-color: #006089; border-radius: 4.0px;&quot;&gt;Perguntas frequentes&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-top: 20.0px;&quot;&gt;\r\n&lt;div style=&quot;margin-bottom: 10px;&quot;&gt;\r\n&lt;div style=&quot;display: inline-block; width: 90%;&quot;&gt;\r\n&lt;div style=&quot;padding: 4px 10px 4px; color: #006089; font-size: 20px;&quot;&gt;&lt;b&gt;Os produtos são novos?&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px 10px 4px; font-size: 14px;&quot;&gt;R: Todos os produtos são novos, não aceitamos qualquer oferta de troca por outra mercadoria.&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-bottom: 10px;&quot;&gt;\r\n&lt;div style=&quot;display: inline-block; width: 90%;&quot;&gt;\r\n&lt;div style=&quot;padding: 4px 10px 4px; color: #006089; font-size: 20px;&quot;&gt;&lt;b&gt;A mercadoria esta disponível a pronta entrega?&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px 10px 4px; font-size: 14px;&quot;&gt;R: Todas as mercadoria são a pronta entrega. Em caso de alguma divergência, agimos com transparência para que possamos lhe atender de forma satisfatória.&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-bottom: 10px;&quot;&gt;\r\n&lt;div style=&quot;display: inline-block; width: 90%;&quot;&gt;\r\n&lt;div style=&quot;padding: 4px 10px 4px; color: #006089; font-size: 20px;&quot;&gt;&lt;b&gt;Qual a diferença entre frete normal e frete expresso?&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px 10px 4px; font-size: 14px;&quot;&gt;R: Na modalidade normal os prazos são mais estendidos, variando de acordo com a região do comprador, já na modalidade Expressa as entregas são efetuada em tempos menores através do sedex.&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-bottom: 10px;&quot;&gt;\r\n&lt;div style=&quot;display: inline-block; width: 90%;&quot;&gt;\r\n&lt;div style=&quot;padding: 4px 10px 4px; color: #006089; font-size: 20px;&quot;&gt;&lt;b&gt;O que faço após ter comprado o produto?&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px 10px 4px; font-size: 14px;&quot;&gt;R: Constará em nosso sistema que o pagamento da mercadoria e nós providenciaremos o envio do produto aos correios, caso seja retirada em mãos, nós encaminharemos um e-mail contendo o endereço correto para retirada do produto.&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;margin-bottom: 10px;&quot;&gt;\r\n&lt;div style=&quot;display: inline-block; width: 90%;&quot;&gt;\r\n&lt;div style=&quot;padding: 4px 10px 4px; color: #006089; font-size: 20px;&quot;&gt;&lt;b&gt;Qual o prazo de envio do produto que comprei?&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;padding: 0px 10px 4px; font-size: 14px;&quot;&gt;R: Todas as vendas são postadas em um prazo máximo de 48 horas após a confirmação do pagamento pelo mercado livre.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',0),(13248,0,'mercadolivre','mercadolivre_shipping_alter','me11',0),(13247,0,'mercadolivre','mercadolivre_shipping_cost5','',0),(13246,0,'mercadolivre','mercadolivre_shipping_cost4','',0),(13245,0,'mercadolivre','mercadolivre_shipping_cost3','',0),(13244,0,'mercadolivre','mercadolivre_shipping_cost2','',0),(13243,0,'mercadolivre','mercadolivre_shipping_cost1','',0),(13242,0,'mercadolivre','mercadolivre_shipping_n